Object.keys(questsData).forEach(key=>{
    let index = Number(key);
    let quest = questsData[key];
    quest.renderMoney = renderSize(quest.needMoney);
    quests.forEach(q=>{
        if (quest.name===q.name){
            if (index<=3){
                quest.buffs = [q.buffs.shift()];
            }else {
                quest.buffs = q.buffs;
            }
        }
    });
});

export default questsData